import { Box, Typography } from '@mui/material';
import React from 'react';

function SignIN(props) {
    return (
        <div>
            <Box width="40%"  sx={{border:"1px solid",margin:"auto",marginTop:"150px"}}>
                  <Typography>Log in to Dashboard</Typography>
            </Box>
        </div>
    );      
}

export default SignIN;
